import React, { useState } from "react";
import IndexNavbar from "components/Navbars/IndexNavbar.js";
import Footerr from "components/Footers/Footerr";

function MyTickets() {
  const [selectedTicket, setSelectedTicket] = useState(null);

  const tickets = [
    {
      id: 1,
      sujet: "Problème d'accès au portail client",
      departement: "Support Technique",
      statut: "Ouvert",
      date: "2024-03-15",
      description: "Impossible d'accéder à mon espace client depuis hier soir.",
    },
    {
      id: 2,
      sujet: "Question sur un virement international",
      departement: "Opérations Bancaires",
      statut: "En cours",
      date: "2024-03-14",
      description: "Demande d'information sur les frais de virement vers l'Asie.",
    },
    {
      id: 3,
      sujet: "Carte bloquée à l'étranger",
      departement: "Cartes Bancaires",
      statut: "Résolu",
      date: "2024-03-10",
      description: "Déblocage de ma carte Visa Premier en Australie.",
    },
  ];

  const getStatusColor = (statut) => {
    switch (statut) {
      case "Ouvert":
        return "bg-red-500";
      case "En cours":
        return "bg-yellow-400";
      case "Résolu":
        return "bg-green-500";
      default:
        return "bg-gray-400";
    }
  };

  return (
    <>
      <IndexNavbar />

      <div className="bg-gray-100 min-h-screen py-10">
        <div className="max-w-6xl mx-auto px-4">
          <h1 className="text-3xl font-bold text-gray-800 mb-8 text-center">🎟️ Gestion des Requêtes</h1>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
            <div className="bg-white rounded-xl shadow p-6">
              <h2 className="text-xl font-semibold text-gray-700 mb-4">📋 Mes Tickets</h2>
              {tickets.map((ticket) => (
                <div
                  key={ticket.id}
                  className="border border-gray-200 rounded-lg p-4 mb-4 hover:shadow-md transition cursor-pointer"
                  onClick={() => setSelectedTicket(ticket)}
                >
                  <div className="flex justify-between items-start">
                    <div>
                      <h3 className="text-lg font-semibold text-blue-700">{ticket.sujet}</h3>
                      <p className="text-sm text-gray-500">{ticket.departement}</p>
                    </div>
                    <span
                      className={`text-xs font-bold text-white px-3 py-1 rounded-full ${getStatusColor(ticket.statut)}`}
                    >
                      {ticket.statut}
                    </span>
                  </div>
                  <div className="flex justify-between items-center mt-2 text-sm text-gray-400">
                    <span>{ticket.date}</span>
                    <svg
                      className="w-5 h-5 text-gray-400"
                      fill="currentColor"
                      viewBox="0 0 24 24"
                    >
                      <path d="M8.59 16.59L13.17 12 8.59 7.41 10 6l6 6-6 6-1.41-1.41z" />
                    </svg>
                  </div>
                </div>
              ))}
            </div>

            {selectedTicket && (
              <div className="bg-white rounded-xl shadow p-6">
                <div className="flex justify-between items-center mb-6">
                  <h2 className="text-xl font-semibold text-gray-700">📝 Détails de la requête</h2>
                  <button
                    onClick={() => setSelectedTicket(null)}
                    className="text-gray-400 text-2xl font-bold hover:text-red-500"
                  >
                    &times;
                  </button>
                </div>
                <div className="space-y-4">
                  <div>
                    <label className="text-sm text-gray-500">Sujet :</label>
                    <p className="text-base text-gray-800 font-medium">{selectedTicket.sujet}</p>
                  </div>
                  <div>
                    <label className="text-sm text-gray-500">Statut :</label>
                    <span
                      className={`inline-block text-xs font-bold text-white px-3 py-1 rounded-full ${getStatusColor(selectedTicket.statut)}`}
                    >
                      {selectedTicket.statut}
                    </span>
                  </div>
                  <div>
                    <label className="text-sm text-gray-500">Date :</label>
                    <p className="text-base text-gray-800">{selectedTicket.date}</p>
                  </div>
                  <div>
                    <label className="text-sm text-gray-500">Description :</label>
                    <p className="text-base text-gray-700 leading-relaxed">
                      {selectedTicket.description}
                    </p>
                  </div>
                </div>
              </div>
            )}
          </div>
        </div>
      </div>

      <Footerr />
    </>
  );
}

export default MyTickets;
